import React from "react";
import '../toPrintListInvo.css';
import { format, getHours, getMinutes } from "date-fns";

export const KblatMasToPrint = React.forwardRef((props, ref) => {


    function GetSakhHkol(){
        let sakh = 0;
        for (let index = 0; index < props.bretem.length; index++) {
            sakh += props.bretem[index].kmot * props.bretem[index].shahLeheda;
        }
        return sakh;
    }

    const handleGetDigits = (number) => {
        const integerPart = Math.floor(number); // Get the integer part of the number
        const fractionalPart = (number % 1).toFixed(2).substring(2); // Get the first two digits after the decimal point
        const formatted = `${integerPart}.${fractionalPart}`; // Concatenate integer and fractional parts
        return formatted;
    };


    return (
        <div ref={ref}>
            <div className="flex justify-center">
                <div className="w-[160px] h-[160px]">
                    <img src="data:image/bmp;base64," />
                </div>
            </div>
            <div className="mt-20 border-t-1 border-b-1 border-black">
                <div className="flex justify-around">
                    <div dir="rtl">
                        
                    </div>
                    <div dir="rtl">
                         : {props?.msbar}
                    </div>
                    <div dir="rtl">
                         
                    </div>
                </div>
            </div>
            <div className="flex justify-around">
                <div dir="rtl">
                    <div>  : {props?.aoskMorshe}</div>
                    <div> : {format(new Date,'dd-MM-yyyy')}</div>
                    <div> : {`${getHours(new Date)}:${getMinutes(new Date)}`}</div>
                </div>
                <div dir="rtl">
                    <div> : {props?.msbarKhem}</div>
                    <div>  : {props?.hktsaMsbar}</div>
                </div>
                <div dir="rtl">
                    <div></div>
                    <div>{props?.Lkbod}</div>
                </div>
            </div>
            <div className="mt-5 border-b-1 border-black">
                <div dir="rtl" className="flex justify-center">
                    . : {props?.taodtZehot}
                </div>
            </div>
            <div className="mt-10">
                <div className="flex justify-center mr-10 ml-10">
                    <table className="w-full">
                        <thead>
                            <tr>
                                <th>" "</th>
                                <th>" </th>
                                <th></th>
                                <th> </th>
                                <th>' </th>
                            </tr>
                        </thead>
                        <tbody>
                            {
                                props?.bretem?.map((bret, index) => {
                                    return <tr>
                                        <th>{bret.kmot * bret.shahLeheda}</th>
                                        <th>{bret.shahLeheda}</th>
                                        <th>{bret.kmot}</th>
                                        <th>{bret.taor}</th>
                                        <th>{index}</th>
                                    </tr>
                                })
                            }
                            <tr className="">
                                <th className="border-b-white">{GetSakhHkol()}</th>
                                <th className="border-b-white">"  "</th>
                            </tr>
                            <tr>
                                <th className="border-b-white">0.0</th>
                                <th className="border-b-white"> % 0.00</th>
                            </tr>
                            <tr>
                                <th className="border-b-white">0.0</th>
                                <th className="border-b-white">"  </th>
                            </tr>
                            <tr>
                                <th className="border-b-white">{GetSakhHkol() * 0.17}</th>
                                <th className="border-b-white">" % 17.00</th>
                            </tr>
                            <tr>
                                <th>{handleGetDigits(GetSakhHkol() + GetSakhHkol() * 0.17)}</th>
                                <th>" </th>
                            </tr>
                        </tbody>
                    </table>
                </div>
            </div>
            <div className="flex justify-around mt-8">
                <div dir="rtl" className="flex text-xs">
                    <div> _____________</div>
                    <div>______________</div>
                    <div>______________</div>
                </div>
                <div dir="rtl" className="text-xs">
                    <div>  :</div>
                    <div>..'  ____________</div>
                </div>
            </div>
            <div className=" absolute bottom-0 left-0 m-20">
                <img className="w-[110px]" src="data:image/png;base64,"/>
            </div>
        </div>
    )
})